INSERT INTO `survey_question` VALUES (1,1,'From the following list of issue areas, please indicate the TOP THREE that are most important to you',2,'',NULL,'{\"max\": 3}',0,NULL),(11,8,'From the following list of issue areas, please indicate the TOP THREE that are most important to you',2,NULL,NULL,'{\"max\":3}',0,NULL),(12,8,'How confident are you that President Trump will win re-election and defeat Joe Biden ?',1,NULL,NULL,NULL,0,NULL),(13,8,'Do you approve or disapprove of the job that Donald Trump is doing as President ?',1,NULL,NULL,NULL,0,NULL),(14,8,'Which of the following comes closest to your own personal opinion ?',1,NULL,NULL,NULL,0,NULL),(15,8,'Do you support or oppose President Trump\'s Supreme Court nominee Amy Coney Barrett having a confirmation vote before the presidential election ?',1,NULL,NULL,NULL,0,NULL),(16,8,'Do you support or oppose a nationwide mask mandate, which would require all Americans to wear masks indoors during public gatherings ?',1,NULL,NULL,NULL,0,NULL),(17,8,'The Trump Administration launched operation Warp Speed to develop a coronavirus vaccine. Do you think President Trump did a very good job, a good Job, a bad job or a very bad job on the process of developing a coronavirus vaccine ?',1,NULL,NULL,NULL,0,NULL),(18,8,'In response to the coronavirus, have local and state Governments been to slow to open up, too fast to open up or about right in opening up in response to the coronavirus ?',1,NULL,NULL,NULL,0,NULL),(19,8,'Switching to some different issues now ... <br/><br/>\n\nWould you be more likely or lesss likely to support a company that donates money to the organization Black Lives Matter Incorporated ?',1,NULL,NULL,NULL,0,NULL),(20,8,'If coronavirus case increase rapidly, do you support or oppose another economic shutdown to try to stop the spread of the virus ?',1,NULL,NULL,NULL,0,NULL),(21,8,'Due to the Coronavirus Pandemic there has been growing push by Democrat Governors to conduct the presidential election largely by mail-in voter. Do you support or oppose of states mostly using mail-in voting insteead of in person voting for elections this year ?',1,NULL,NULL,NULL,0,NULL),(22,8,'Section 230 of the Communications Decency Act gives Google immunity because they are a platform and not considered a publisher of content. Some claim that Google acts as a publisher because they remove content and censor information. Do you think that Google should be protected by Section 230 and should be treated as a platform, or should they not allowed to censor and remove content because they are a publisher ?',1,NULL,NULL,NULL,0,NULL),(23,8,'If Socialist Democrats succeed in defunding our police departments, it is likely that you will have to be your own first responder in an emergency. In this possible scenario do you think the Government should increase gun restrictions, decrease gun restrictions, or keep gun laws as they are now ?',1,NULL,NULL,NULL,0,NULL),(24,8,'Please indicate if you agree or disagree with the following statement<br/><br/>It\'s is important for Israel to maintain control of the \"West Bank\" in order to ensure peace and security in the Middle East, especially for Judeo-Christian heritage sites ?',1,NULL,NULL,NULL,0,NULL),(25,8,'And lastly, switching topics now to Israel and the Middle East ... <br/>As you may know, President Trump negotiated a peace deal between Israel and the Muslim countries of the United Arab Emirates and Bahrain. As of result of this historic diplomatic achievement, do you think President Trump should receive the Nobel Peace Prize ?',1,NULL,NULL,NULL,0,NULL),(26,8,'For the safety and security of the Middle East, how important is it to you that Israel assert and maintain sovereignty over the country\'s strategic high ground and Judeo-Christian heritage sites ?',1,NULL,NULL,NULL,0,NULL),(27,8,'What is your gender ?',1,NULL,NULL,NULL,0,_binary ''),(28,8,'Please indicate if you agree or disagree with the following statement<br/> Palestinians would protect free